import Header from '../../components/header/index';
import { Container, Body } from '../stylesGlobal/styles';

const ConsultaMes = () => {

  return (
    <Container>     
      <Header /> 
      <Body>       
      <h1> Aqui mostrará uma tabela de aniversariantes conforme mês selecionado </h1>    
      </Body>
    </Container>
  );
}

export default ConsultaMes
